/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import "./Shared.css";
import "./Press.css";
import "./Footer.css";
import { Footer } from "./Footer";

export const Press: React.FC = () => {
    return (
        <div className="main">
            <h1 className="intro">Press kit.</h1>
            <p>Good morning, Tech report. We would love if you would like to write something about us. Want to know more? <a href="mailto:press@csd.red">Mail us</a> or Signal us at 00 46 783 15 01 02.
            <br /><br />
            <a href="Press.zip">Here is a link</a> to higher resolution versions of the images below.
            </p>

            <img id="app" src="./images/hertz-mockup.png" />
            <p className="image-text">
                <span>
                    Hertz<span>.</span>
                </span>{" "}
                interface.
            </p>
            <br />

            <img id="app" src="./images/team-1.png" />
            <p className="image-text">Tom√°s, Ana, Bjorn, Jenny and Mikael.</p>
            <br />

            <img id="app" src="./images/hz-in-use.png" />
            <p className="image-text">
                <span>
                    Hertz<span>.</span>
                </span>{" "}
                in use.
            </p>

            <img id="app" src="./images/our-story-KI.png" />
            <p className="image-text">The Karolinska Institute.</p>
            <br />

            <h2>Every day better.</h2>
            <Footer />
        </div>
    );
};
